const ArchivoRegular = `@font-face { font-family: 'Archivo'; font-style: normal; font-weight: 400; src: local('Archivo Regular'), local('Archivo-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const Archivo500 = `@font-face { font-family: 'Archivo'; font-style: normal; font-weight: 500; src: local('Archivo Medium'), local('Archivo-Medium'), url('data:font/woff2;base64,') format('woff2'); }`;
const ArchivoItalic = `@font-face { font-family: 'Archivo'; font-style: italic; font-weight: 400; src: local('Archivo Italic'), local('Archivo-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Archivo600 = `@font-face { font-family: 'Archivo'; font-style: normal; font-weight: 600; src: local('Archivo SemiBold'), local('Archivo-SemiBold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Archivo500italic = `@font-face { font-family: 'Archivo'; font-style: italic; font-weight: 500; src: local('Archivo Medium Italic'), local('Archivo-MediumItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Archivo600italic = `@font-face { font-family: 'Archivo'; font-style: italic; font-weight: 600; src: local('Archivo SemiBold Italic'), local('Archivo-SemiBoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
